import React from 'react'
import CartItem from './CartItem'

function Cart(products, cart, handler) {
    console.log('Cart ');
    Object.keys(cart).forEach(key => {
        console.log(key)
    })
    return (
        Object.keys(cart).forEach(key => {
            return <CartItem product={products.find(prod => prod.id == key)} count={cart[key]} deletionHandler={handler} />
        })
    )
}

export default Cart
